import React, { useEffect, useState } from 'react';
import axios from 'axios';
import styled from 'styled-components';

const AppContainer = styled.div`
  min-height: 100vh;
  background: #000000;
  color: #ffffff;
  font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Oxygen, Ubuntu, Cantarell, sans-serif;
`;

const Header = styled.header`
  padding: 2rem;
  background: rgba(0, 0, 0, 0.8);
  backdrop-filter: blur(20px);
  position: sticky;
  top: 0;
  z-index: 10;
`;

const Title = styled.h1`
  font-size: 3.5rem;
  font-weight: 700;
  text-align: center;
  margin: 0;
  background: linear-gradient(135deg, #ffffff 0%, #888888 100%);
  -webkit-background-clip: text;
  -webkit-text-fill-color: transparent;
  letter-spacing: -0.02em;
`;

const ContentContainer = styled.div`
  max-width: 1200px;
  margin: 0 auto;
  padding: 2rem;
`;

const CourseGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(350px, 1fr));
  gap: 2rem;
  padding: 1rem;
`;

const CourseCard = styled.div`
  background: rgba(255, 255, 255, 0.05);
  border-radius: 20px;
  padding: 2rem;
  transition: all 0.3s ease;
  border: 1px solid rgba(255, 255, 255, 0.1);
  position: relative;
  overflow: hidden;

  &:hover {
    transform: translateY(-5px);
    background: rgba(255, 255, 255, 0.08);
    box-shadow: 0 20px 40px rgba(0, 0, 0, 0.4);
  }

  &::before {
    content: '';
    position: absolute;
    top: 0;
    left: 0;
    right: 0;
    height: 1px;
    background: linear-gradient(90deg, transparent, rgba(255, 255, 255, 0.2), transparent);
  }
`;

const CourseTitle = styled.h2`
  font-size: 1.5rem;
  font-weight: 600;
  margin: 0 0 1.5rem 0;
  color: #ffffff;
  letter-spacing: -0.01em;
`;

const CourseInfo = styled.div`
  display: flex;
  align-items: center;
  margin: 0.8rem 0;
  color: #888888;
  font-size: 0.95rem;
`;

const InfoLabel = styled.span`
  color: #666666;
  margin-right: 0.5rem;
  font-weight: 500;
`;

const ParticipantCount = styled.div`
  margin-top: 1.5rem;
  padding-top: 1.5rem;
  border-top: 1px solid rgba(255, 255, 255, 0.1);
  display: flex;
  justify-content: space-between;
  align-items: center;
`;

const LoadingContainer = styled(AppContainer)`
  display: flex;
  justify-content: center;
  align-items: center;
  min-height: 100vh;
`;

const LoadingText = styled(Title)`
  font-size: 2rem;
  opacity: 0.8;
`;

const ErrorContainer = styled(LoadingContainer)``;

const ErrorText = styled(LoadingText)`
  color: #ff3b30;
`;

function App() {
    const [courses, setCourses] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);

    useEffect(() => {
        const fetchCourses = async () => {
            try {
                const response = await axios.get('http://localhost:3008/api/courses');
                setCourses(response.data.slice(0, 10));
                setLoading(false);
            } catch (error) {
                console.error('Feil ved henting av kursdata:', error);
                setError('Kunne ikke hente kursdata. Vennligst prøv igjen senere.');
                setLoading(false);
            }
        };

        fetchCourses();
    }, []);

    if (loading) {
        return (
            <LoadingContainer>
                <LoadingText>Laster kurs...</LoadingText>
            </LoadingContainer>
        );
    }

    if (error) {
        return (
            <ErrorContainer>
                <ErrorText>{error}</ErrorText>
            </ErrorContainer>
        );
    }

    return (
        <AppContainer>
            <Header>
                <Title>Kommende Kurs</Title>
            </Header>
            <ContentContainer>
                <CourseGrid>
                    {courses.map(course => (
                        <CourseCard key={course.id}>
                            <CourseTitle>{course.title}</CourseTitle>
                            <CourseInfo>
                                <InfoLabel>Dato:</InfoLabel>
                                {new Date(course.startDate).toLocaleDateString('nb-NO', {
                                    year: 'numeric',
                                    month: 'long',
                                    day: 'numeric'
                                })}
                            </CourseInfo>
                            <CourseInfo>
                                <InfoLabel>Sted:</InfoLabel>
                                {course.location}
                            </CourseInfo>
                            <ParticipantCount>
                                <CourseInfo>
                                    <InfoLabel>Påmeldte:</InfoLabel>
                                    {course.participantCount} / {course.maxParticipants}
                                </CourseInfo>
                                {course.participantCount >= course.maxParticipants && (
                                    <span style={{ color: '#ff3b30' }}>Fullt</span>
                                )}
                            </ParticipantCount>
                        </CourseCard>
                    ))}
                </CourseGrid>
            </ContentContainer>
        </AppContainer>
    );
}

export default App;
